import Header from './Header'
import Front from '../pages/front'

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
}

export default function Layout(props) {
  return (
  	<div>
	    <Header/>
	    <Front/>

	    <style jsx> {`
	    	div {
	    		margin: 0;
	    	}

    	`}
    </style>
    </div>
  )
}
